import * as Screens from './screens';
import moment from 'moment';

// REUSABLE FUNCTIONS ---
const sortEntries = (arr) => {
  arr.sort((a, b) => moment(b.date + b.time, ['MM/DD/YYYYh:mm a']).format('YYYYMMDDHHmm') - moment(a.date + a.time, ['MM/DD/YYYYh:mm a']).format('YYYYMMDDHHmm'));
}

function App() {
  const globalProps = { sortEntries };
  return (
    <div className="App">
      <Screens.Diary.Main {...globalProps} />
    </div>
  );
}

export default App;
